import React from 'react';
import { Link } from 'react-router-dom';

const CloseButton = () => {
    return (
      <button onClick={() => window.close()}>Close Application</button>
    );
  }

const Navbar = () => {
    return (
      <ul style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', backgroundColor: '#333', color: '#fff' }}>
        <li><a href="/" style={{ color: '#fff', textDecoration: 'none', padding: '1rem' }}>Close Button</a></li>
        <li><Link to="/about" style={{ color: '#fff', textDecoration: 'none', padding: '1rem' }}>About</Link></li>
        <li><Link to="/news" style={{ color: '#fff', textDecoration: 'none', padding: '1rem' }}>News</Link></li>
      </ul>
    );
  }


export default Navbar;
